import React from "react";
import DesignComponentProject from "./DesignComponent/DesignComponentProject";
import Chat from "../../src/Video/Tchat.mp4";
import Pacman from "../../src/Video/Pacman.mp4";
import {Grid, Paper} from "@material-ui/core";
import useStyles from "./useStyles";
import {makeStyles} from "@material-ui/styles";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";

const useStylesCard = makeStyles({
    root: {
        minWidth: 275,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});

function CardCustom(props) {
    const classes = useStylesCard();
    return (
        <Card className={classes.root} variant="outlined">
            <CardContent>
                <Typography className={classes.title} color="textSecondary" gutterBottom>
                    Word of the Day
                </Typography>
                <Typography variant="h5" component="h2">
                    hjom
                </Typography>
                <Typography className={classes.pos} color="textSecondary">
                    adjective
                </Typography>
                <Typography variant="body2" component="p">
                    well meaning and kindly.
                    <br />
                    {'"a benevolent smile"'}
                </Typography>
            </CardContent>
            <CardActions>
                <Button size="small">Learn More</Button>
            </CardActions>
        </Card>
    )
}

function Project(){
    const styles = useStyles();
    return (
        <>
            <h1>Projets</h1>
            <Grid container spacing={5}>
                <Grid item xs={2}>
                    <Paper className={styles.paper}>
                        <CardCustom/>
                    </Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper className={styles.paper}>xs=6</Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper className={styles.paper}>xs=6</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper className={styles.paper}>xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper className={styles.paper}>xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper className={styles.paper}>xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper className={styles.paper}>xs=3</Paper>
                </Grid>
            </Grid>
            <DesignComponentProject
                setTitle={'Programme de communication multi-client en C (Unix)'}
                srcVideo={Chat}
                linkGithub={'https://github.com/Antonin-Artaud/Project-C/tree/master/Socket'}
            />
            <DesignComponentProject
                setTitle={'Pacman en C (Unix)'}
                srcVideo={Pacman}
                linkGithub={'https://github.com/Antonin-Artaud/Project-C/tree/master/Pacman'}
            />
        </>
    )
}

export default Project;
